import { style } from "typestyle";

const QuizButtonStyle = style({
    backgroundColor: 'red',
    $nest: {
        '& button': {
            backgroundColor: 'red',
            minWidth: '150px',
            padding: '20px',
            fontFamily: 'GothamBold',
        }
    }
})

export default QuizButtonStyle
